concept.definition:
Study
A study is a collection of one or more series of medical images, presentation states, and/or SR documents that are logically related for the purpose of diagnosing a patient. A study may include composite instances that are created by a single modality, multiple modalities or by multiple devices of the same modality. [From SectionA.1.2.2 Study IE in PS3.3
]

Series
A distinct logical set used to group composite instances. All instances within a Series are of the same modality, in the same Frame of Reference (if any), and created by the same equipment. [See SectionA.1.2.3 Series IE in PS3.3
]

Performed Procedure Step
An arbitrarily defined unit of service that has actually been performed (not just scheduled). [From Section7.3.1.9 Modality Performed Procedure Step in PS3.3
]
